import React from 'react';

class EditPage extends React.Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return (
      <div onClick={() => this.props.history.push('/')}>
        EditPage{console.log(this.props.location.state)}
      </div>
    );
  }
}

export default EditPage;
